const UbuntuMonoRegular = `@font-face { font-family: 'Ubuntu Mono'; font-style: normal; font-weight: 400; src: local('Ubuntu Mono'), local('UbuntuMono-Regular'), url('data:font/woff2;base64,') format('woff2'); }`;
const UbuntuMonoItalic = `@font-face { font-family: 'Ubuntu Mono'; font-style: italic; font-weight: 400; src: local('Ubuntu Mono Italic'), local('UbuntuMono-Italic'), url('data:font/woff2;base64,') format('woff2'); }`;
const UbuntuMono700 = `@font-face { font-family: 'Ubuntu Mono'; font-style: normal; font-weight: 700; src: local('Ubuntu Mono Bold'), local('UbuntuMono-Bold'), url('data:font/woff2;base64,') format('woff2'); }`;
const UbuntuMono700italic = `@font-face { font-family: 'Ubuntu Mono'; font-style: italic; font-weight: 700; src: local('Ubuntu Mono Bold Italic'), local('UbuntuMono-BoldItalic'), url('data:font/woff2;base64,') format('woff2'); }`;
